%%
%[text] 初始化参数和状态
tic;

global params states_r

fprintf('1. 初始化参数和状态...\n'); %[output:882911f9]
params = init_params(); 
states_r = struct();
Y0 = init_Y();

params.disease_type=2; %@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
params.disease_Healthy=0;
params.disease_GNAT1=1; %先天性夜盲
params.disease_PDE6AB=2;
if(params.disease_type==params.disease_GNAT1)
    params.kG1_0 = 0;
elseif(params.disease_type==params.disease_PDE6AB)
    params.betasub = 0;
end

toc; %[output:35b72ae3]
%%
%[text] 仿真设置
tic;

fprintf('仿真设置...\n'); %[output:4a368377]

t_total = 5.0; % s
flash_start = 0.5; % s
flash_duration = 0.02; % s
% light_intensities = [1.7, 4.8, 15.2, 39.4, 125, 444, 1406, 4630];
light_intensities = [4630];

% 添加光刺激参数到params结构体
params.flash_start = flash_start;
params.flash_duration = flash_duration;
params.stimulus = 0; % 初始为0

% ODE 求解器选项 - 使用更严格的容差
options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
                 'MaxStep', 0.001, ...  % 限制最大步长
                 'InitialStep', 1e-6);  % 使用小的初始步长

% options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
%                  'MaxStep', 0.001, ...  % 限制最大步长
%                  'InitialStep', 1e-6);  % 使用小的初始步长


% 添加电刺激参数到params结构体
params.stimwavetype=2;
WAVE_BiTrap=1;
WAVE_ATrape_DS=2; % different slope
WAVE_AIrreglar_DS=3;

if(params.stimwavetype==WAVE_BiTrap)
    params.f=0.2;
    params.stim_amp = -40e-6; %@@

    params.stim_t_total = t_total;
    params.stim_start = 0.5; 
    % params.stim_phase_dur = 0.02;
    % params.stim_interval = params.stim_phase_dur/2;    
    % params.stim_var_time=params.stim_phase_dur/4;
    
    dur=0.02;
    var=dur/4;
    amp=params.stim_amp;
    inter=dur/2;
    
    params.stim_keypoint_t=[0, var, dur-var, dur, dur+inter, dur+inter+var, 2*dur+inter-var, 2*dur+inter];
    params.stim_linparam=[...
            (amp/var)            0   ; ...
            (-amp/var)   amp*dur/var ; ...
            (-amp/var)   amp*(dur+inter)/var ; ...
            (amp/var)   -amp*(2*dur+inter)/var ; ...
            ];
elseif(params.stimwavetype==WAVE_ATrape_DS)
    params.f=0.2;
    params.stim_amp = 40e-6; %@@

    params.stim_t_total = t_total;
    params.stim_start = 0.5; 

    dur=3;
    var1=dur*(1/10);
    var2=dur*(4/10);
    amp=params.stim_amp;

    params.stim_keypoint_t=[0, var1, dur-var2, dur];
    params.stim_linparam=[...
            (amp/var1)            0   ; ...
            (-amp/var2)   amp*dur/var2 ; ...
            ];

elseif(params.stimwavetype==WAVE_AIrreglar_DS)

end


%
tt=0:1e-6:5;
I_values = zeros(size(tt)); 
for i = 1:length(tt)
    if (tt(i)<params.stim_start)
        I_values(i) =0;
    else
        I_values(i) = I_func(tt(i)-0.5); 
    end
end

% 绘制I_func波形
figure; %[output:4a384a15]
plot(tt, I_values); %[output:4a384a15]
title('I_func Waveform'); %[output:4a384a15]
xlabel('Time (s)'); %[output:4a384a15]
ylabel('I_func Output'); %[output:4a384a15]
grid on; %[output:4a384a15]
xlim([0 params.stim_t_total]); %[output:4a384a15]
disp('I_func波形绘制完毕') %[output:28bdc42b]

